	INSERT INTO RDS.DimNOrDStatuses (
		NeglectedOrDelinquentProgramTypeCode
		, NeglectedOrDelinquentProgramTypeDescription
		, NeglectedOrDelinquentProgramTypeEdFactsCode
		, NeglectedProgramTypeCode
		, NeglectedProgramTypeDescription
		, NeglectedProgramTypeEdFactsCode
		, DelinquentProgramTypeCode
		, DelinquentProgramTypeDescription
		, DelinquentProgramTypeEdFactsCode
		, NeglectedOrDelinquentLongTermStatusCode
		, NeglectedOrDelinquentLongTermStatusDescription
		, NeglectedOrDelinquentLongTermStatusEdFactsCode
	)
	SELECT tmp.NeglectedOrDelinquentProgramTypeCode
		, tmp.NeglectedOrDelinquentProgramTypeDescription
		, tmp.NeglectedOrDelinquentProgramTypeEdFactsCode
		, tmp.NeglectedProgramTypeCode
		, tmp.NeglectedProgramTypeDescription
		, tmp.NeglectedProgramTypeEdFactsCode
		, tmp.DelinquentProgramTypeCode
		, tmp.DelinquentProgramTypeDescription
		, tmp.DelinquentProgramTypeEdFactsCode
		, tmp.NeglectedOrDelinquentLongTermStatusCode
		, tmp.NeglectedOrDelinquentLongTermStatusDescription
		, tmp.NeglectedOrDelinquentLongTermStatusEdFactsCode
	FROM #TMP_NorD tmp
	LEFT JOIN RDS.DimNOrDStatuses main
		ON tmp.NeglectedProgramTypeCode = main.NeglectedProgramTypeCode
		AND tmp.DelinquentProgramTypeCode = main.DelinquentProgramTypeCode
		AND tmp.NeglectedOrDelinquentLongTermStatusCode = main.NeglectedOrDelinquentLongTermStatusCode
	WHERE main.DimNOrDStatusId IS NULL

--remove the 'c' from the report code in the report tables
	update rds.ReportEDFactsK12StaffCounts
	set ReportCode = substring(ReportCode, 2, 3)
	where len(ReportCode) = 4
	and substring(ReportCode, 1,1) = 'c'

	update rds.ReportEDFactsK12StudentCounts
	set ReportCode = substring(ReportCode, 2, 3)
	where len(ReportCode) = 4
	and substring(ReportCode, 1,1) = 'c'

	update rds.ReportEDFactsK12StudentDisciplines
	set ReportCode = substring(ReportCode, 2, 3)
	where len(ReportCode) = 4
	and substring(ReportCode, 1,1) = 'c'

	update rds.ReportEDFactsK12StudentAssessments
	set ReportCode = substring(ReportCode, 2, 3)
	where len(ReportCode) = 4
	and substring(ReportCode, 1,1) = 'c'
